INSERT INTO `backlog_simple` (`id`, `sprint_id`, `codigo`, `titulo`, `descricao`, `prioridade`, `pontos`, `concluido_em`, `criado_em`) VALUES
(1, 1, 'US-01', 'Como gestor do hospital, quero ver a porcentagem de ocupação dos leitos em tempo real para priorizar alocação de pacientes e recursos.', 'Painel com porcentagem de ocupação, thresholds e alertas automáticos.', 1, 5, NULL, '2025-11-22 13:34:46'),
(2, 1, 'US-02', 'Como enfermeiro, quero monitorar temperatura e umidade por área para garantir condições adequadas aos pacientes.', 'Monitoramento contínuo, histórico 24h e alertas para valores fora do padrão.', 1, 5, NULL, '2025-11-22 13:34:46'),
(3, 1, 'US-03', 'Como técnico de suporte, quero visualizar níveis de oxigênio por sala/leito para detectar rapidamente hipóxia ou falhas.', 'Leitura em tempo real e histórico com alertas de O₂ baixo.', 1, 3, NULL, '2025-11-22 13:34:46'),
(4, 1, 'US-04', 'Como médico, quero receber leituras de CO₂ por área para identificar riscos de qualidade do ar.', 'Exibição de ppm, tendência e alertas quando ultrapassar o limiar.', 1, 3, NULL, '2025-11-22 13:34:46'),
(5, 1, 'US-05', 'Como gestor de energia, quero acompanhar consumo em tempo real e picos por zona para reduzir custos.', 'Dashboard com consumo instantâneo, total, picos e exportação CSV.', 2, 5, NULL, '2025-11-22 13:34:46'),
(6, 1, 'US-06', 'Como coordenador administrativo, quero ver atendimentos por dia para planejar equipe e recursos.', 'Relatório diário com filtros e média móvel.', 2, 3, NULL, '2025-11-22 13:34:46'),
(7, 1, 'US-07', 'Como enfermeiro, quero histórico de telemetria por leito (24h) para correlacionar eventos clínicos.', 'Histórico de temperatura, umidade, O₂, CO₂ e consumo por leito.', 2, 8, NULL, '2025-11-22 13:34:46'),
(8, 1, 'US-08', 'Como técnico de facilities, quero automação HVAC baseada em temperatura e ocupação.', 'Regras configuráveis, simulações e economia de energia.', 3, 5, NULL, '2025-11-22 13:34:46'),
(9, 1, 'US-09', 'Como equipe de integração, quero APIs com dados agregados (ocupação, alertas, consumo) para integrar com sistemas hospitalares.', 'Endpoints documentados com autenticação e filtros.', 2, 5, NULL, '2025-11-22 13:34:46'),
(10, 1, 'US-10', 'Concluído: Resumo Executivo Automático (IA)', 'Automação que gera sumários executivos com insights e anomalias. (Implementado)', 1, 5, '2025-11-12', '2025-11-22 13:34:46'),
(11, 1, 'US-11', 'Concluído: Integração com BI (Power BI / Tableau)', 'Embedding, iframes e endpoints para exportação. (Implementado)', 1, 3, '2025-11-15', '2025-11-22 13:34:46'),
(12, 1, 'US-12', 'Como PO, quero um simulador de carga que gere cenários de pico para testar alertas.', 'Simulador configurável produzindo datasets de pico.', 3, 5, NULL, '2025-11-22 13:34:46'),
(13, 1, 'US-13', 'Como auditor, quero logs normalizados das leituras IoT para rastreabilidade.', 'Persistência padronizada com timestamps e payloads validados.', 3, 3, NULL, '2025-11-22 13:34:46'),
(14, 1, 'US-14', 'Como usuário final, quero dashboards correlacionando ambiente, ocupação e atendimento.', 'Painéis de insights, filtros e exportação.', 2, 5, NULL, '2025-11-22 13:34:46'),
(15, 1, 'US-15', 'Como equipe de segurança, quero detectar anomalias para acionar protocolos.', 'Fila de incidentes e regras de detecção.', 1, 8, NULL, '2025-11-22 13:34:46');
